sys_variable_value.value:
(function execute(inputs, outputs) {
 var validPatterForFolder = /^folders\/[^/]+$/;
  if (!validPatterForFolder.test(idOfFolder)) {
    throw new Error("Name of the folder is in /^folders\/[^/]+$/ format : " + inputs.nameOfRole); 
  }
})(inputs, outputs);

