sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = JSON.parse(inputs.response_body);
  if(inputs.status_code == "200") {
  	outputs.status = "Success";
    outputs.name = responseBody.name;
    outputs.parent = responseBody.parent;
    outputs.displayName = responseBody.displayName;
    outputs.lifecycleState = responseBody.lifecycleState;
    outputs.createTime = responseBody.createTime;    

    outputs.folder = responseBody;
    outputs.folder.name = responseBody.name;
    outputs.folder.parent = responseBody.parent;
    outputs.folder.displayName = responseBody.displayName;
    outputs.folder.lifecycleState = responseBody.ilifecycleState;
    outputs.folder.createTime = responseBody.createTime;
  } else {
  	outputs.status = "Error";
    outputs.error_message = new GoogleIdentityAccessErrorHandler().handleError(responseBody.error); 
  }
})(inputs, outputs);

